import { Grid } from '@material-ui/core';
import React from 'react';
import img from './work.jpg'

const SpRegister = () => {
    return (  <div>
       <Grid container>
      <Grid item md={1}>

      </Grid>
      <Grid item md={7}>
      <img style={{marginTop:'20px'}} src={img}></img>
      </Grid>
      <Grid item md={3}> 

      </Grid>
      <Grid item md={1}>

      </Grid>
       </Grid>
    </div>);
}
 
export default SpRegister;
